CREATE TABLE countries (
  id bigserial NOT NULL primary key,
  country_name_cn varchar(50),
  country_name varchar(50),
  iso_country_code varchar(20)
);

comment on column countries.country_name_cn is '国家中文名称';
comment on column countries.country_name is '国家英文名称';
comment on column countries.iso_country_code is '国家编码';



CREATE TABLE cities (
  id bigserial NOT NULL primary key,
  city_name_cn varchar(50),
  city_long_name_cn varchar(80),
  city_name varchar(50),
  city_long_name varchar(80),
  city_code varchar(20),
  iso_country_code varchar(20)
);

comment on column cities.city_name_cn is '城市中文名称';
comment on column cities.city_long_name_cn is '城市中文长名称';
comment on column cities.city_name is '城市英文名称';
comment on column cities.city_long_name is '城市英文长名称';
comment on column cities.city_code is '城市编码';
comment on column cities.iso_country_code is '国家编码';

